import { Fragment } from 'react'
import { useHistory } from "react-router-dom";

const Experience = () => {
  const history = useHistory()

  const handleChooseExperience = (e) => {
    const experienceType = e.target.id
    history.push(`experience/${experienceType}`)
  }

  return (
    <Fragment>
      <div className="w-screen h-screen grid">
        <div className="flex flex-col justify-center items-center">
          <h1 className="font-montserrat-bold text-16 w-32 text-center">Souhaitez vous une expérience...</h1>
          <button className="mb-1" onClick={(e) => handleChooseExperience(e)} id='inside'>
            <p className="font-montserrat-bold text-21 border-2 border-white-500 rounded-xl px-8">À l'intérieur</p>
          </button>
          <button onClick={(e) => handleChooseExperience(e)} id='outdoor'>
            <p className="font-montserrat-bold text-21 border-2 border-white-500 rounded-xl px-8">À l'extérieur</p>
          </button>
        </div>
      </div>
    </Fragment>
  )
}

export default Experience
